class CSLTest(tf.test.TestCase):

    def test_next(self):
        datasetex = DebugCTMCDataset("P=? [ X (\"full\") ]", qualitative=False)
        loader = SingleGraphLoader(datasetex, epochs=1)
        model = build_model(datasetex, max_exit_rate=4.5, config=CompilationConfig.xae_config)
        x, y = loader.load().__iter__().__next__()
        self.assertAllEqual(y, model.call(x))

    def test_unbounded_until(self):
        datasetuu = DebugCTMCDataset("P=? [ !\"empty\" U \"full\" ]", qualitative=False)
        loader = SingleGraphLoader(datasetuu, epochs=1)
        model = build_model(datasetuu, max_exit_rate=4.5, config=CompilationConfig.xae_config)
        x, y = loader.load().__iter__().__next__()
        self.assertAllClose(y, model.call(x), atol=0.001)
        print(model.call(x))

    def test_interval_until(self):
        # case 0, inf
        datasetiu1 = DebugCTMCDataset("P=? [ true U>=0 \"full\" ]", qualitative=False)
        loader1 = SingleGraphLoader(datasetiu1, epochs=1)

        model = build_model(datasetiu1, max_exit_rate=4.5, config=CompilationConfig.xae_config)

        x, y = loader1.load().__iter__().__next__()
        self.assertAllClose(y, model.call(x), atol=0.001)

        # case 0, t
        datasetiu2 = DebugCTMCDataset("P=? [ true U[0, 7.5] \"full\" ]", qualitative=False)
        loader1 = SingleGraphLoader(datasetiu2, epochs=1)

        model = build_model(datasetiu2, max_exit_rate=4.5, config=CompilationConfig.xae_config)

        x, y = loader1.load().__iter__().__next__()
        self.assertAllClose(y, model.call(x), atol=0.001)

        # case 0, t (bis)
        datasetiu2b = DebugCTMCDataset("P=? [ true U<=7.5 \"full\" ]", qualitative=False)
        loader1 = SingleGraphLoader(datasetiu2b, epochs=1)

        model = build_model(datasetiu2b, max_exit_rate=4.5, config=CompilationConfig.xae_config)

        x, y = loader1.load().__iter__().__next__()
        self.assertAllClose(y, model.call(x), atol=0.001)

        # case t1, t2
        datasetiu3 = DebugCTMCDataset("P=? [ true U[5, 7.5] \"full\" ]", qualitative=False)
        loader1 = SingleGraphLoader(datasetiu3, epochs=1)

        model = build_model(datasetiu3, max_exit_rate=4.5, config=CompilationConfig.xae_config)

        x, y = loader1.load().__iter__().__next__()
        self.assertAllClose(y, model.call(x), atol=0.001)

        # case t1, inf
        datasetiu4 = DebugCTMCDataset("P=? [ true U>=7.5 \"full\" ]", qualitative=False)
        loader1 = SingleGraphLoader(datasetiu4, epochs=1)

        model = build_model(datasetiu4, max_exit_rate=4.5, config=CompilationConfig.xae_config)

        x, y = loader1.load().__iter__().__next__()
        self.assertAllClose(y, model.call(x), atol=0.001)

    def test_steady_state(self):
        datasetss = DebugCTMCDataset("S=? [ \"full\" ]", qualitative=False)
        loader1 = SingleGraphLoader(datasetss, epochs=1)

        model = build_model(datasetss, max_exit_rate=4.5, config=CompilationConfig.xae_config)

        x, y = loader1.load().__iter__().__next__()
        self.assertAllClose(y, model.call(x), atol=0.001)


if __name__ == '__main__':
    tf.test.main()
